    try{
        console.log(req.body);
        var name=req.body.Name;
        var pw=req.body.Password;
        var test=await student_jwt.findOne({Name:name,Password:pw});
        console.log(test);
        if(test){
            var  token=jwt.sign({
                id:test._id
            },keys.secret,{
                expiresIn:'5m'
            });
            var send={response:'success',token};

            console.log(token);
            console.log(send);
            ch=token;
            res.send(send);

        }
        else{
            res.send("not found");
            console.log('no');
        }

    }
    catch(err){
        console.log('log',err)
    }
}

