            }
        })

        var check= await i_student_jwt.save();
        res.send('hi');
        console.log('hi');


    }
    catch(err){
        console.log(err);
    }
}

export const next=(req,res)=>{
    console.log('next');
    console.log(req.headers);
    var token= req.headers['token'];
    console.log(token);
    jwt.verify(token,keys.secret,async(err,payload)=>{
